import actionTypes from "../actions/actionTypes";

const initialState = {
    isLoggedIn: false,
    userInforr: null,
};

const appReducer = (state = initialState, action) => {
    switch (action.type) {
        // case actionTypes.USER_LOGIN_SUCCESS:
        //     return {
        //         ...state,
        //         isLoggedIn: true,
        //         userInforr: action.userInforr,
        //     };
        default:
            return state;
    }
};

export default adReducer;
